import React from 'react'
import './navBar.css';

// import * as data from '../../static/data/navBar.json'
const data = [
	{
		"type": "Stays",
		"icon": "fa-bed",
		"active": true
	},
	{
		"type": "Flights",
		"icon": "fa-plane",
		"active": false
	},
	{
		"type": "Car rentals",
		"icon": "fa-car",
		"active": false
	},
	{
		"type": "Attractions",
		"icon": "fa-bed",
		"active": false
	},
	{
		"type": "Airport taxis",
		"icon": "fa-taxi",
		"active": false
	}
]


function NavBar() {
  return (
    <div>
        <h2 className='website-title'>Booking Website</h2>
        <div>
        <button>Login</button>
        <button>Register</button>
        </div>
        <div className=''>
            {
                data && data.map((item) => {
                return (
                    <ul>
                    <li key={item.type} >
					<i className={item.icon}>{item.type}</i>
                        
                    </li>
                </ul>
                )
            })
            }
        </div>
        

    </div>
    
  )
}

export default NavBar
